import './CategoryField.css'

function CategoryField(props){
    return(
        <div>
            <div className= 'div-category'>
                <div className= 'div-empty-white-filler'></div>
                <h2 className= 'category-name'>{props.categoryName}</h2>
                <hr className= 'category-ruler'/>
            </div>
            {props.children}
        </div>
        
    )
}

export default CategoryField;
